var domTT_oneOnly = true;
var mouseoverids=[];
var cache_content = {};
var pending=null;

function onmouseover_callback(thisx, event, delay, width, title, content){
    var id=domTT_activate(thisx, event, 'content', content, 'trail', false, 'direction', 'southeast', 'clearMouse', true, 'delay', delay, 'maxWidth', width, 'caption', title, 'type', 'velcro', 'draggable', false);
    mouseoverids.push(id);
}

function topic_onmouseover(thisx, event, topicid, title){
    var width=400;
    var delay=100;
    if(window.innerWidth<420) width = window.innerWidth-20;
    if(window.innerWidth>1000) width=700;
    else delay=500;
    if(event.type=="click") delay=0;
    var content;
    if(typeof(cache_content[topicid])!='undefined'){
        content = cache_content[topicid];
        pending = topicid;
        onmouseover_callback(thisx, event, delay, width, title, content);
    }else{
        if(window.hasOwnProperty("RVPNSTATUS")&&RVPNSTATUS==true){
            pending = topicid;
            $.ajax({url:"/topic/"+topicid+"/onmouseover.html",
            "success":function(content){
                    cache_content[topicid] = content;
                    if(pending!=topicid) return;
                    onmouseover_callback(thisx, event, delay, width, title, content);
                }
            });
        }else{
            pending = topicid;
            var x=$.ajax({dataType:"json", url:"/topic/"+topicid+"/onmouseover","dataType":"json", 
                "success":function(x){
                    if(x.topic_lastPostUser!=x.lastPostUser){
                        console.log("onmouseover not newest "+topicid);
                        $.get("/topic/"+topicid+"/666666");
                    }
                    var content= x.html;
                    cache_content[topicid] = content;
                    if(pending!=topicid) return;
                    var oldurl = location.href;
                    history.replaceState(null,null,'/dispbbs.asp?id='+topicid+"#reply"+x.replycount);
                    history.replaceState(null,null,oldurl);
                    onmouseover_callback(thisx, event, delay, width, title, content);
                }
            });
        }
    }
}
