var removefavorite_dict = {};
function removefavorite(thisx){
    var topicid=thisx.parentNode.childNodes[0].value;
    $(thisx).text("正在请求...");
    if(!removefavorite_dict[topicid]){
        $.get("/topic/"+topicid+"/removefavorite", null, function(data){
            if("ok"==data){
                //thisx.parentNode.parentNode.parentNode.parentNode.parentNode.remove();
                removefavorite_dict[topicid] = true;
                $(thisx).text("已经从收藏中移除，撤销(再次加入收藏)？");
                $.get("/me/favorite/refresh");
            }else{
                alert('取消收藏失败');
            }
        });
    }else{
        $.get("/topic/"+topicid+"/addfavorite", null, function(data){
            if("ok"==data){
                removefavorite_dict[topicid] = false;
                $(thisx).text("加入收藏成功，取消收藏？");
                $.get("/me/favorite/refresh");
            }else{
                alert('加入收藏失败');
            }
        });
    }
}
